import React from "react";

function Nav() {
  return (
    <ul>
      <li>Home</li>
      <li>About</li>
      <li>Menu</li>
      <li>Reservations</li>
      <li>Order Online</li>
      <li>Login</li>
    </ul>
  );
}

export default Nav;
